import React from 'react';

class MainContent extends React.Component {
  render() {
    return (
      <div>
        <div className="mainContentbg">
          <div className="container">
            <div className="row">
              <div className="col-7">123</div>
              <div className="col-5">456</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default MainContent;
